import '../css/Header.css';
import {Link} from "react-router-dom";


const Header = ({socket}) => {
    const handleOnClick = () => {
        socket.disconnect()
        socket.io({forceNew: true})
    }

    return (
        <div className='Header'>
            <Link id='headerLink' to='/' onClick={handleOnClick}> WORDLE WITH FRIENDS </Link>
        </div>
    );
}

export default Header;
